import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Header from "./components/Header";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
      </div>
      ;
      <Routes>
        <Route element={<App />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
